Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		_parent.移动("右",慢速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",慢速度);
	}
}
function 攻击时四向移动(上, 下, 左, 右)
{
	if (上 != 0)
	{
		_parent.移动("上",上);
	}
	else if (下 != 0)
	{
		_parent.移动("下",下);
	}
	if (左 != 0)
	{
		_parent.方向改变("左");
		_parent.移动("左",左);
	}
	else if (右 != 0)
	{
		_parent.方向改变("右");
		_parent.移动("右",右);
	}
}

function 冲锋枪射击()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点1);
	子弹属性.声音 = "hk53.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 5;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "穿刺子弹";
	子弹属性.子弹威力 = 5 * _parent.空手攻击力;
	子弹属性.子弹速度 = 75;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 5;
	子弹属性.击中后子弹的效果 = "";
	子弹属性.子弹敌我属性 = !_parent.是否为敌人;
	_root.子弹区域shoot传递(子弹属性);
}

function 手枪射击()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点2);
	子弹属性.声音 = "fr506.wav";
	子弹属性.霰弹值 = 1;
